import { palsInfo } from "../Utils/data.json";

const Pals = () => {
  return (
    <>
      <section id="pals">
        <div>
          <div className="arrowsNav">
            <picture>&lt;</picture>
          </div>

          <div className="arrowsNav">
            <picture>&gt;</picture>
          </div>

          {
            palsInfo.map(t => {
              return (
                <div className="palsInfo">
                  <h1>OUR CLIENTS APPROVE</h1>
                  <p>
                    Lorem ipsum dolor, sit amet consectetur adipisicing elit.
                    Possimus voluptas tempore dolorum voluptatem nihil delectus
                    illo impedit modi, minima expedita, totam aliquid optio! Odio
